import { Auth } from "./Auth";

export const Header = () => {
  return (
    <header>
      <h1>
        <Link to="/">front-end proyecto 2</Link>
      </h1>
      <nav>
        <Auth />
      </nav>
    </header>
  );
};

export default Header;
